const ListNeedhelp=(props)=>{


  

  console.log(props)
  return(
  <div class="card" > 
  <h2 class="card-header">{props.person.name}</h2>
  <div class="card-body">
  
  
   <NavLink to={'/nh/'+props.person._id}><button type="button" class="btn btn-primary">Подробнее</button></NavLink>
  </div>
</div>

  )}
export default ListNeedhelp
